import React, { Fragment } from 'react';

export const ImageBox = () => {
  return (
    <Fragment>
      <li>
        <span>
          <img src='image/refb/img3.png' className='img-fluid activeimg' />
        </span>
      </li>
    </Fragment>
  );
};
